    wdot[36] += q; /* C5H10-1 */
    wdot[82] -= q; /* C7H14O2-4 */
    /* d()/d[HO2] */
    dqdci =  + k_f*sc[82];
    J[990] -= dqdci;              /* dwdot[HO2]/d[HO2] */
    J[991] += dqdci;              /* dwdot[H2O2]/d[HO2] */
    J[1001] += dqdci;             /* dwdot[CH3CO]/d[HO2] */
