    phi_r = sc[12]*sc[16]*sc[57];
    Kc = refC * exp(g_RT[11] - g_RT[12] - g_RT[16] - g_RT[57] + g_RT[81]);
    k_r = k_f / Kc;
    dlnKcdT = invT * (-(h_RT[11] + h_RT[81]) + (h_RT[12] + h_RT[16] + h_RT[57]) - 1.000000);
