    J[1084] += dqdci;             /* dwdot[C2H4]/d[H2O2] */
    J[1125] += dqdci;             /* dwdot[NC4H9CO]/d[H2O2] */
    J[1149] -= dqdci;             /* dwdot[C7H14O1-3]/d[H2O2] */
