    J[7844] += dqdT;              /* dwdot[H2O2]/dT */
    J[7848] += dqdT;              /* dwdot[C2H4]/dT */
    J[7889] += dqdT;              /* dwdot[NC4H9CO]/dT */
    J[7913] -= dqdT;              /* dwdot[C7H14O1-3]/dT */

    /*reaction 387: C7H14O2-4 + HO2 <=> C3H6 + NC3H7CO + H2O2 */
    /*a non-third-body and non-pressure-fall-off reaction */
    /* forward */
    phi_f = sc[11]*sc[82];
    k_f = 1.0000000000000002e-06 * 5000000000000
                * exp(0 * tc[0] - 0.50321666580471969 * (17700) * invT);
    dlnkfdT = 0 * invT + 0.50321666580471969 *  (17700)  * invT2;
