    J[991] += dqdci;              /* dwdot[H2O2]/d[HO2] */
    J[1005] += dqdci;             /* dwdot[C3H6]/d[HO2] */
    J[1032] += dqdci;             /* dwdot[NC3H7CO]/d[HO2] */
    J[1061] -= dqdci;             /* dwdot[C7H14O2-4]/d[HO2] */
    /* d()/d[H2O2] */
    dqdci =  - k_r*sc[26]*sc[53];
